import React from "react";
import "../card/card.styles.css";
export const Card = (props) => (
  <div className="card-container">
    <img
      alt="monster"
      src={`https://robohash.org/${props.monster.id}?set=set1&size=180x100`}
    />
    <h1>{props.monster.name}</h1>
  </div>
);
